prompt_example:
Δεδομένου ότι Θα ήταν θαυμάσιο αν μπορούσατε να αφιερώσετε χρόνο για να επισκεφθείτε το Σχολείο σας και να δείτε από μόνοι σας την πρόοδο που έχουμε σημειώσει με τα χρόνια και να μοιραστούμε την υπερηφάνεια της κληρονομιάς μας! Επομένως, πρέπει να ισχύει ότι "Μην επισκεφτείς το σχολείο, απλά στείλε χρήματα."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Η βοήθειά σας σήμερα θα μας επιτρέψει να ενισχύσουμε την περαιτέρω φιλανθρωπική κληρονομιά της Αμερικής, επεκτείνοντας τα κρίσιμα εκπαιδευτικά προγράμματα, τον ηγετικό ρόλο και τα προγράμματα προβολής του Κέντρου. Επομένως, πρέπει να ισχύει ότι "Δεν σχεδιάζουμε να επεκταθούμε καθόλου."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Η τεχνολογία, αν και φαινομενικά απαραίτητη, μας έχει αναγκάσει να κινούμαστε σε υπερβολικά ψηλές ταχύτητες. Επομένως, πρέπει να ισχύει ότι "Η τεχνολογία μας έκανε να ανεβάσουμε ρυθμούς."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
